import React from 'react';
import {} from 'react-icons/fi';

import './styles.css';
import logoimage from '../../assets/logo.svg';

export default function Profiles(){
    return(
        <div className="profiles-container">
            <header>
                <img src={logoimage} alt="Be The Hero" />
            </header>
        </div>
        
    );
}
